INSERT INTO `basic_lottery` VALUES (1, 0, '重庆', '重庆时时彩', 0, 1, 0, '10:00~02:00', '<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    一、<span style=\"font-family: 宋体\">开奖时间：每天早上十点到晚上</span>22<span style=\"font-family:宋体\">点，每十分钟一期，晚上</span>22<span style=\"font-family:宋体\">点到凌晨</span>2<span style=\"font-family:宋体\">点每五分钟一期。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    二、<span style=\"font-family: 宋体\">每次开奖五个号、每个号（</span>0----9<span style=\"font-family:宋体\">）例如：</span>10895<span style=\"font-family:宋体\">。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    三、<span style=\"font-family: 宋体\">时时彩游戏玩法介绍及游戏规则</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    1.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">总和大：五个号的开奖结果相加＞或者＝</span>23<span style=\"font-family:宋体\">，为总和大。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    2.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">总和小：五个号的开奖结果相加＜或者＝</span>22<span style=\"font-family:宋体\">，为总和小。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    3.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">总和单：五个号的开奖结果相加尾数为单数，为总和单。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    4.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">总和双：五个号的开奖结果相加尾数为双数，为总和双。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    5.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">龙：开奖结果的第一球大于第五球为龙。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    6.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">虎：开奖结果的第一球小于第五球为虎。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    7.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">和：开奖结果的第一球与第五球一样为和。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    8.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">每个球都可以定位买大</span>&nbsp; <span style=\"font-family:宋体\">小</span>&nbsp; <span style=\"font-family:宋体\">单</span>&nbsp; <span style=\"font-family:宋体\">双，</span>56789<span style=\"font-family:宋体\">为大</span>01234<span style=\"font-family:宋体\">为小</span>13579<span style=\"font-family:宋体\">为单</span>24680<span style=\"font-family:宋体\">为双。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    9.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">定位球：即买任意位上的任意一个号码，例如：买一球</span>5<span style=\"font-family:宋体\">，或者买三球</span>0&nbsp; 2<span style=\"font-family:宋体\">。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    10.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体\">前三、中三、后三，可以分为以下买法：</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span style=\"text-indent: 37px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;（1）</span><span style=\"text-indent: 37px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 9px; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span><span style=\"text-indent: 37px; font-family: 宋体;\">顺子：即前三个开奖数字可以相连，如：</span><span style=\"text-indent: 37px;\">123</span><span style=\"text-indent: 37px; font-family: 宋体;\">、</span><span style=\"text-indent: 37px;\">019</span><span style=\"text-indent: 37px; font-family: 宋体;\">、</span><span style=\"text-indent: 37px;\">456</span><span style=\"text-indent: 37px; font-family: 宋体;\">，等等。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"text-indent: 37px; margin-left: 28px;\">\r\n    <span style=\"text-indent: 25px;\">（2） </span><span style=\"text-indent: 25px; font-family: 宋体;\">半顺：即前三个开奖数字可以相连，如：</span><span style=\"text-indent: 25px;\">145</span><span style=\"text-indent: 25px; font-family: 宋体;\">、</span><span style=\"text-indent: 25px;\">589</span><span style=\"text-indent: 25px; font-family: 宋体;\">、</span><span style=\"text-indent: 25px;\">236</span><span style=\"text-indent: 25px; font-family: 宋体;\">，等等。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"text-indent: 37px; margin-left: 28px;\">\r\n    <span style=\"text-indent: 25px;\">（3） </span><span style=\"text-indent: 25px; font-family: 宋体;\">杂六：即前三个开奖数字可以相连，如：</span><span style=\"text-indent: 25px;\">135</span><span style=\"text-indent: 25px; font-family: 宋体;\">、</span><span style=\"text-indent: 25px;\">469</span><span style=\"text-indent: 25px; font-family: 宋体;\">、</span><span style=\"text-indent: 25px;\">825</span><span style=\"text-indent: 25px; font-family: 宋体;\">，等等。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"text-indent: 37px; margin-left: 28px;\">\r\n    <span style=\"text-indent: 25px;\">（4） </span><span style=\"text-indent: 25px; font-family: 宋体;\">对子：即前三个开奖数字有且只有两个数字一样，如：</span><span style=\"text-indent: 25px;\">228</span><span style=\"text-indent: 25px; font-family: 宋体;\">、</span><span style=\"text-indent: 25px;\">882</span><span style=\"text-indent: 25px; font-family: 宋体;\">、</span><span style=\"text-indent: 25px;\">007</span><span style=\"text-indent: 25px; font-family: 宋体;\">，</span><span style=\"text-indent: 25px;\"> </span><span style=\"text-indent: 25px; font-family: 宋体;\">等等。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"text-indent: 25px;\">\r\n    &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;（5） <span style=\"font-family:宋体\">豹子：即前三个开奖数字都相同，如：</span>555<span style=\"font-family:宋体\">、</span>222<span style=\"font-family:宋体\">、</span>999<span style=\"font-family:宋体\">，等等。</span>\r\n</p>', NULL);
INSERT INTO `basic_lottery` VALUES (2, 1, '北京', '北京赛车', 0, 1, 3, '09:00~24:00', '<p>\r\n    <span style=\"font-family:宋体\">北京赛车（原名：北京福彩</span>“PK<span style=\"font-family:宋体\">拾</span>”<span style=\"font-family:宋体\">）规则说明</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-family:宋体\">该游戏的投注时间、开奖时间和开奖号码与</span>“<span style=\"font-family:宋体\">北京</span>PK<span style=\"font-family:宋体\">拾</span>”<span style=\"font-family:宋体\">完全同步（官方网），北京时间（</span>GMT+8<span style=\"font-family:宋体\">）每天白天从上午</span>09<span style=\"font-family:宋体\">：</span>02<span style=\"font-family:宋体\">开到晚上</span>23<span style=\"font-family:宋体\">：</span>57<span style=\"font-family:宋体\">，每</span>5<span style=\"font-family:宋体\">分钟开一次奖，每天开奖</span>179<span style=\"font-family:宋体\">期。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-family:宋体\">具体游戏规则如下：</span>\r\n</p>\r\n<p>\r\n    1~10<span style=\"font-family:宋体\">两面：</span><span style=\"font-family:宋体\">指</span> <span style=\"font-family: 宋体\">单、双；大，小。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-family:宋体\">单、双：</span><span style=\"font-family:宋体\">号码为双数叫双，如</span>4<span style=\"font-family:宋体\">、</span>8<span style=\"font-family:宋体\">；号码为单数叫单，如</span>5<span style=\"font-family:宋体\">，</span>9<span style=\"font-family:宋体\">。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-family:宋体\">大、小：</span><span style=\"font-family:宋体\">开出之号码大于或等于</span>6<span style=\"font-family:宋体\">为大，小于或等于</span>5<span style=\"font-family:宋体\">为小。</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-family:宋体\">第一名</span>~<span style=\"font-family:宋体\">第十名</span> <span style=\"font-family:宋体\">车号指定</span>:<span style=\"font-family:宋体\">每一个车号为一投注组合，开奖结果“投注车号”对应所投名次视为中奖，其余情形视为不中奖。</span>\r\n</p>\r\n<p>\r\n    1~5<span style=\"font-family:宋体\">龙虎【注意规则】为：</span><span style=\"font-family:宋体\"></span>\r\n</p>\r\n<p>\r\n    &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:宋体\">冠军龙</span>/<span style=\"font-family:宋体\">虎：</span>“<span style=\"font-family:宋体\">第一名</span>”<span style=\"font-family:宋体\">车号大于</span>“<span style=\"font-family:宋体\">第十名</span>”<span style=\"font-family:宋体\">车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。</span>\r\n</p>\r\n<p style=\"text-indent:28px\">\r\n    <span style=\"font-family:宋体\">亚军龙</span>/<span style=\"font-family:宋体\">虎：</span>“<span style=\"font-family:宋体\">第二名</span>”<span style=\"font-family:宋体\">车号大于</span>“<span style=\"font-family:宋体\">第九名</span>”<span style=\"font-family:宋体\">车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。</span>\r\n</p>\r\n<p style=\"text-indent:28px\">\r\n    <span style=\"font-family:宋体\">第三名龙</span>/<span style=\"font-family:宋体\">虎：</span>“<span style=\"font-family:宋体\">第三名</span>”<span style=\"font-family:宋体\">车号大于</span>“<span style=\"font-family:宋体\">第八名</span>”<span style=\"font-family:宋体\">车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。</span>\r\n</p>\r\n<p style=\"text-indent:28px\">\r\n    <span style=\"font-family:宋体\">第四名龙</span>/<span style=\"font-family:宋体\">虎：</span>“<span style=\"font-family:宋体\">第四名</span>”<span style=\"font-family:宋体\">车号大于</span>“<span style=\"font-family:宋体\">第七名</span>”<span style=\"font-family:宋体\">车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。</span>\r\n</p>\r\n<p style=\"text-indent:28px\">\r\n    <span style=\"font-family:宋体\">第五名龙</span>/<span style=\"font-family:宋体\">虎：</span>“<span style=\"font-family:宋体\">第五名</span>”<span style=\"font-family:宋体\">车号大于</span>“<span style=\"font-family:宋体\">第六名</span>”<span style=\"font-family:宋体\">车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。</span>\r\n</p>\r\n<p>\r\n    “<span style=\"font-family:宋体\">冠军车号＋亚军车号＝冠亚和值</span>”\r\n</p>\r\n<p>\r\n    &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:宋体\">冠亚和单双：</span>“<span style=\"font-family:宋体\">冠亚和值</span>”<span style=\"font-family:宋体\">为单视为投注</span>“<span style=\"font-family:宋体\">单</span>”<span style=\"font-family:宋体\">的注单视为中奖，为双视为投注</span>“<span style=\"font-family:宋体\">双</span>”<span style=\"font-family:宋体\">的注单视为中奖，其余视为不中奖</span>\r\n</p>\r\n<p style=\"text-indent:28px\">\r\n    <span style=\"font-family:宋体\">冠亚和大小：</span>“<span style=\"font-family:宋体\">冠亚和值</span>”<span style=\"font-family:宋体\">大于</span>11<span style=\"font-family:宋体\">时投注</span>“<span style=\"font-family:宋体\">大</span>”<span style=\"font-family:宋体\">的注单视为中奖，小于或等于</span>11<span style=\"font-family:宋体\">时投注</span>“<span style=\"font-family:宋体\">小</span>”<span style=\"font-family:宋体\">的注单视为中奖，其余视为不中奖</span>\r\n</p>\r\n<p style=\"text-indent: 28px;\">\r\n    <span style=\"font-family:宋体\">冠亚和指定：</span><span style=\"font-family:宋体\"></span>“<span style=\"font-family:宋体\">冠亚和值</span>”<span style=\"font-family:宋体\">可能出现的结果为</span>3~19<span style=\"font-family:宋体\">，投中对应</span>“<span style=\"font-family:宋体\">冠亚和值</span>”<span style=\"font-family:宋体\">数字的视为中奖，其余视为不中奖</span>\r\n</p>', NULL);
INSERT INTO `basic_lottery` VALUES (3, 5, '澳门', '乐乐五分彩', 1, 1, 0, '全天', '<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>一、</span><span style=\"font-family: 宋体\">开奖时间：全天，每五分钟一期。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>二、</span><span style=\"font-family: 宋体\">每次开奖五个号、每个号（</span><span>0----9</span><span style=\"font-family:宋体\">）例如：</span><span>10895</span><span style=\"font-family:宋体\">。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>三、</span><span style=\"font-family: 宋体\">时时彩游戏玩法介绍及游戏规则</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>1.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">总和大：五个号的开奖结果相加＞或者＝</span><span>23</span><span style=\"font-family:宋体\">，为总和大。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>2.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">总和小：五个号的开奖结果相加＜或者＝</span><span>22</span><span style=\"font-family:宋体\">，为总和小。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>3.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">总和单：五个号的开奖结果相加尾数为单数，为总和单。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>4.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">总和双：五个号的开奖结果相加尾数为双数，为总和双。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>5.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">龙：开奖结果的第一球大于第五球为龙。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>6.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">虎：开奖结果的第一球小于第五球为虎。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>7.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">和：开奖结果的第一球与第五球一样为和。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>8.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">每个球都可以定位买大</span><span>&nbsp; </span><span style=\"font-family:宋体\">小</span><span>&nbsp; </span><span style=\"font-family:宋体\">单</span><span>&nbsp; </span><span style=\"font-family:宋体\">双，</span><span>56789</span><span style=\"font-family:宋体\">为大</span><span>01234</span>