INSERT INTO `basic_lottery` VALUES (8, 10, '澳门', '澳门快三', 1, 1, 1, '全天', '<p>\r\n    <span style=\"font-family:宋体\">澳门快</span><span>3</span><span style=\"font-family:宋体\">：俗称筛子彩票，由中国福利彩票发行管理中心组织销售、澳门特别行政区福利彩票发行中心承销</span>\r\n</p>\r\n<p>\r\n    <span style=\"font-family:宋体\">开奖时间：每天</span><span>1440</span><span style=\"font-family:宋体\">期、每</span><span>1</span><span style=\"font-family:宋体\">分钟</span><span>1</span><span style=\"font-family:宋体\">期；</span><span>24</span><span style=\"font-family:宋体\">小时不间断开奖；</span><span><br/> </span><span style=\"font-family:宋体\">开奖号码：开奖结果为</span><span>3</span><span style=\"font-family:宋体\">个号码，每个号码由</span><span>1-6</span><span style=\"font-family:宋体\">组成；</span>\r\n</p>\r\n<p>\r\n    <strong><span style=\"font-family:宋体\">和值：</span></strong>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>1.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">和值：</span><span>3</span><span style=\"font-family:宋体\">个开奖号码相加的和，即为和值。如：下注</span><span>12</span><span style=\"font-family:宋体\">，开奖号码为</span><span>246</span><span style=\"font-family:宋体\">，即为中奖</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>2.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">和值大小：</span><span>3</span><span style=\"font-family:宋体\">个开奖号码相加的和，</span><span>3-10</span><span style=\"font-family:宋体\">为小，</span><span>11-18</span><span style=\"font-family:宋体\">为大。如：下注小，开奖号码为</span><span>113</span><span style=\"font-family:宋体\">，即为中奖</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-