left:28px\">\r\n    <span>2.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">三同号单选：对三同号中的任意一个进行投注，所选号码开出，即为中奖。</span>\r\n</p>', '2018-05-31 18:23:58');
INSERT INTO `lottery_category` VALUES (11, 4, '新疆', '新疆时时彩', '/uploadFile/res/icon_xj_ssc.png', 0, 1, 0, 1, 10, '10:10~02:00', '<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>一、</span><span style=\"font-family: 宋体\">开奖时间：每天早上十点到晚上</span><span>22</span><span style=\"font-family:宋体\">点，每十分钟一期，晚上</span><span>22</span><span style=\"font-family:宋体\">点到凌晨</span><span>2</span><span style=\"font-family:宋体\">点每五分钟一期。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>二、</span><span style=\"font-family: 宋体\">每次开奖五个号、每个号（</span><span>0----9</span><span style=\"font-family:宋体\">）例如：</span><span>10895</span><span style=\"font-family:宋体\">。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>三、</span><span style=\"font-family: 宋体\">时时彩游戏玩法介绍及游戏规则</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>1.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">总和大：五个号的开奖结果相加＞或者＝</span><span>23</span><span style=\"font-family:宋体\">，为总和大。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>2.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">总和小：五个号的开奖结果相加＜或者＝</span><span>22</span><span style=\"font-family:宋体\">，为总和小。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>3.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">总和单：五个号的开奖结果相加尾数为单数，为总和单。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>4.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">总和双：五个号的开奖结果相加尾数为双数，为总和双。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>5.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">龙：开奖结果的第一球大于第五球为龙。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>6.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">虎：开奖结果的第一球小于第五球为虎。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>7.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">和：开奖结果的第一球与第五球一样为和。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>8.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">每个球都可以定位买大</span><span>&nbsp; </span><span style=\"font-family:宋体\">小</span><span>&nbsp; </span><span style=\"font-family:宋体\">单</span><span>&nbsp; </span><span style=\"font-family:宋体\">双，</span><span>56789</span><span style=\"font-family:宋体\">为大</span><span>01234</span><span style=\"font-family:宋体\">为小</span><span>13579</span><span style=\"font-family:宋体\">为单</span><span>24680</span><span style=\"font-family:宋体\">为双。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>9.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">定位球：即买任意位上的任意一个号码，例如：买一球</span><span>5</span><span style=\"font-family:宋体\">，或者买三球</span><span>0&nbsp; 2</span><span style=\"font-family:宋体\">。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>10.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">前三、中三、后三，可以分为以下买法：</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>11.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">顺子：即前三个开奖数字可以相连，如：</span><span>123</span><span style=\"font-family:宋体\">、</span><span>019</span><span style=\"font-family:宋体\">、</span><span>456</span><span style=\"font-family:宋体\">，等等。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>12.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">半顺：即前三个开奖数字可以相连，如：</span><span>145</span><span style=\"font-family:宋体\">、</span><span>589</span><span style=\"font-family:宋体\">、</span><span>236</span><span style=\"font-family:宋体\">，等等。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>13.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">杂六：即前三个开奖数字可以相连，如：</span><span>135</span><span style=\"font-family:宋体\">、</span><span>469</span><span style=\"font-family:宋体\">、</span><span>825</span><span style=\"font-family:宋体\">，等等。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>14.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">对子：即前三个开奖数字有且只有两个数字一样，如：</span><span>228</span><span style=\"font-family:宋体\">、</span><span>882</span><span style=\"font-family:宋体\">、</span><span>007</span><span style=\"font-family:宋体\">，</span> <span style=\"font-family:宋体\">等等。</span>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:28px\">\r\n    <span>15.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:宋体\">豹子：即前三个开奖数字都相同，如：</span><span>555</span><span style=\"font-family:宋体\">、</span><span>222</span><span style=\"font-family:宋体\">、</span><span>999</span><span style=\"font-family:宋体\">，等等。</span>\r\n</p>', '2018-05-31 18:23:58');
INSERT INTO `lottery_category` VALUES (12, 7, '香港', '香港六合彩', '/uploadFile/res/icon_xg_lhc.png', 0, 1, 5, 0, 11, '周二、四、六', '<p style=\"margin: 5px 0\">\r\n    香港六合彩：由香港政府授权香港赛马会组织销售；<span style=\"font-family: Arial, sans-serif\"><br/> </span>开奖时间：每周三次，通常于周二、周四及周六或周日晚上举行；<span style=\"font-family: Arial, sans-serif\"><br/> </span>开奖号码：从<span style=\"font-family: Arial, sans-serif\">01-49</span>共<span style=\"font-family: Arial, sans-serif\">49</span>个号码中任选<span style=\"font-family: Arial, sans-serif\">1</span>或多个号码进行投注，每期开出<span style=\"font-family: Arial, sans-serif\">6</span>个正码和<span style=\"font-family: Arial, sans-serif\">1</span>个特码为中奖号码，竞猜<span style=\"font-family: Arial, sans-serif\">7</span>位开奖号码的全部或部分号码。投注方式灵活，全面满足不同彩民的投注需要；\r\n</p>\r\n<p style=\"margin: 5px 0\">\r\n    <strong>特码</strong>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 28px\">\r\n    <span style=\"font-family: Arial, sans-serif\">1.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span>特码直选：从<span style=\"font-family: Arial, sans-serif\">1-49</span>中任选一个或者多个号码，每个号码为一注，所选号码与开奖号码最后一位相同，即为中奖。\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 28px\">\r\n    <span style=\"font-family: Arial, sans-serif\">2.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span>两面：开奖号码最后一位为特码，大于或者等于<span style=\"font-family: Arial, sans-serif\">25</span>为特码大，小于或者等于<span style=\"font-family: Arial, sans-serif\">24</span>为特码小；奇数为单，偶数为双；特码两个数相加后得数，奇数为合单，偶数为合双，小于等于<span style=\"font-family: Arial, sans-serif\">6</span>为合小，大于<span style=\"font-family: Arial, sans-serif\">6</span>为合大；尾大尾小即看特码个位数值，小于等于<span style=\"font-family: Arial, sans-serif\">4</span>为小，大于<span style=\"font-family: Arial, sans-serif\">4</span>为大；特码为<span style=\"font-family: Arial, sans-serif\">49</span>时为和，不算任何大小单双，但算波色与家禽野兽。\r\n</p>\r\n<p style=\"margin: 5px 0\">\r\n    <strong>正码</strong>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 28px\">\r\n    <span style=\"font-family: Arial, sans-serif\">3.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span>任选：从<span style=\"font-family: Arial, sans-serif\">1-49</span>中任选一个或者多个号码，每个号码为一注，所选号码在开奖号码前<span style=\"font-family: Arial, sans-serif\">6</span>位中存在，即为中奖。\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 28px\">\r\n    <span style=\"font-family: Arial, sans-serif\">4.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size: 9px;font-family: &#39;Times New Roman&#39;, serif\">&nbsp;</span>正码特：从<span style=\"font-family: Arial, sans-serif\">1-49</span>中任选一个或者多个号码，每个号码为一注，所选号码与开奖号码对应位置的号码相同，即为中奖。\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 28px\">\r\n    <span style=\"font-family: Arial, sans-serif\">5.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span>正码凉面：开奖号对应位置的号码（如；正一两面即第一位），大于或者等于<span style=\"font-family: Arial, sans-serif\">25</span>为特码大，小于或者等于<span style=\"font-family: Arial, sans-serif\">24</span>为特码小；奇数为单，偶数为双；和单和双为两个数相加后得数的单双，尾大尾小即看个位数值，小于等于<span style=\"font-family: Arial, sans-serif\">4</span>为小，大于<span style=\"font-family: Arial, sans-serif\">4</span>为大；特码为<span style=\"font-family: Arial, sans-serif\">49</span>时为和，不算任何大小单双，但算波色。\r\n</p>\r\n<p style=\"margin: 5px 0\">\r\n    <strong>半波</strong>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 28px\">\r\n    <span style=\"font-family: Arial, sans-serif\">1.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span>特码半波：根据特码对应的特性来区分，分为红蓝绿三个波色，以及号码大于或者等于<span style=\"font-family: Arial, sans-serif\">25</span>为大，小于或等于<span style=\"font-family: Arial, sans-serif\">24</span>为小；奇数为单，偶数为双；合单合双为开奖号的十位与个位相加后得数的单双，特码是<span style=\"font-family: Arial, sans-serif\">49</span>时为和，不算任何大小单双。投注内容与号码特性完全吻合，即为中奖。\r\n</p>\r\n<p style=\"margin: 5px 0\">\r\n    <strong>生肖</strong>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 28px\">\r\n    <span style=\"font-family: Arial, sans-serif\">1.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span>特肖：从十二生肖中任选一个或多个，每个生肖为一注，所选生肖与特码对应的生肖相同，即为中奖。\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 28px\">\r\n    <span style=\"font-family: Arial, sans-serif\">2.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span>一肖：从十二生肖中任选一个或多个，每个生肖为一注，开奖号码（含特码）中含有投注所属生肖，即为中奖。\r\n</p>\r\n<p style=\"margin: 5px 0\">\r\n    <strong>尾数</strong>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 28px\">\r\n    <span style=\"font-family: Arial, sans-serif\">1.<span style=\"font-variant-numeric: normal;font-variant-east-asian: normal;font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span>特码头尾：选择特码头（十位）尾（个为）的数字进行投注，与特码相同，即为中奖。\r\n</p>', '2018-05-31 18:23:58');
