INSERT INTO `lottery_room_type` VALUES (7, 2, '保本厅', '/uploadFile/res/bg_cjf.png', 0, '(1)开13/14总注小于等于10000时，大小单双赔率1.5倍，组合赔率1倍<br/>\r\n(2)开13/14总注大于10000时，大小单双赔率1倍，组合赔率1倍<br/>\r\n(3)单注10起，20000封顶，总注80000封顶<br/>', '（4.6/4.2玩法）', '(1)当天下注满10期<br/>\r\n(2)组合比例不低于30%<br/>\r\n(3)严禁刷水，三无玩家一律无回水<br/>\r\n(4)符合条件，平台于0点-6点之间审核结算至您的账户，不支持提前结算<br/>', '0', '10');
INSERT INTO `lottery_room_type` VALUES (8, 2, '返水厅', '/uploadFile/res/bg_zjf.png', 1, '(1)开13/14，大小单双总注小于等于1000时，大小单双赔率1.6倍<br/>\r\n(2)开13/14，大小单双总注1001-10000时，大小单双赔率1.5倍<br/>\r\n(3)开13/14，组合总注50-10000时，赔率2.5倍<br/>\r\n(4)开13/14，所有的类型，总注大于10000时，大小单双和组合类型赔率均为1倍<br/>', '（最高回水28%）', '(1)当天下注满10期<br/>\r\n(2)组合比例不低于30%<br/>\r\n(3)严禁刷水，三无玩家一律无回水<br/>\r\n(4)符合条件，平台于0点-6点之间审核结算至您的账户，不支持提前结算<br/>', '500', '50');
